const Footer = () => (
  <footer style={styles.footer}>
    <p>&copy; 2024 GreenL</p>
  </footer>
);

const styles = {
  footer: {
    backgroundColor: '#4CAF50',
    color: 'white',
    padding: '10px 20px',
    textAlign: 'center',
    position: 'fixed',
    bottom: 0,
    width: '100%',
  },
};

export default Footer;
